const Http={async get(e){let r=await fetch(e);return r.json()},post(e,r){let t=fetch(e,{method:"POST",mode:"cors",cache:"no-cache",credentials:"same-origin",headers:{"Content-Type":"application/json"},referrerPolicy:"no-referrer",body:JSON.stringify(r)}).then(e=>e.json());return t},put(e,r){let t=fetch(e,{method:"PUT",mode:"cors",cache:"no-cache",credentials:"same-origin",headers:{"Content-Type":"application/json"},referrerPolicy:"no-referrer",body:JSON.stringify(r)}).then(e=>e.json());return t},delete(e,r){let t=fetch(e,{method:"DELETE",mode:"cors",cache:"no-cache",credentials:"same-origin",headers:{"Content-Type":"application/json"},referrerPolicy:"no-referrer",body:JSON.stringify(r)}).then(e=>e.json());return t}};